  \"2015-08-07T07:19:28.368531\",\n\t\"name\": \"collection-of-baseline-studies-of-the-food-for-peace-title-ii-development-food-assistance-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"USAID's Office of Food for Peace (FFP) awards
  funding to private voluntary organizations (PVOs) to design and implement multi-year
  Title II development food assistance programs.  The main purpose of the Title II
  program is to improve long-term food security of chronically food insecure population
  in the targeted regions. As countries start new programs, USAID conducts baseline
  surveys to assess the current status of key indicators, develop a better understanding
  of prevailing conditions and perceptions of the population in the targeted areas,
  and serve as a point of comparison for future final evaluations.  Results are also
  used to further refine program targeting and, where possible, to understand the
  relationship between variables to inform program design.\",\n\t\"license_title\":
